-- 5) скрипты характерных выборок (включающие группировки, JOIN'ы, вложенные таблицы);
-- 1) выбрать коментарии к новости пользователей младше 16 лет 
select body from comments
where user_id in 
  (select id from users where id in 
    (SELECT user_id from profiles where timestampdiff(year,birthday, now()) < 16));
-- 2) выбрать игроков команды с id = 23 
SELECT player_id from players where player_team_id in 
  (SELECT team_id from basketball_team where team_id = 23);
-- 3) выбрать тренеров, у которого количество побед больше, чем поражений 
select c.coach_id, ct.game_win, ct.game_lose
  from coaches c 
  join basketball_team bt on bt.team_id = c.coach_id
  join conference_table ct on ct.team_id = c.coach_id and ct.game_win  > ct.game_lose;
-- 4) выбрать игрока из команды с 24 победами
select p.player_id
  from players p 
  join basketball_team bt on bt.team_id = p.player_team_id
  join conference_table ct on ct.team_id = p.player_team_id and ct.game_win = 24;
-- 5) выбрать юзеров , написавших коментарий к новости с id 35
select u.id 
  from users u
  join comments c on c.user_id = u.id 
  join news n on n.id = c.news_id and n.id = 35
  group by u.id;
-- 6) выберите тренеров, которые тренируют игроков с ростом 200
select c.coach_id
from coaches c
join basketball_team bt on bt.team_id = c.coach_id
join players p on bt.team_id = p.player_team_id and p.tall = 200;

-- 7) представления (минимум 2);
-- представление в котором игроки в команде с id 4 будут представлены по росту
create view team_4_tall as 
  select p.player_id, p.tall from players p 
  join basketball_team bt on bt.team_id = p.player_team_id and bt.team_id = 4
  order by p.tall;
 
-- представление в котором юзеры представлены по возрасту
create view users_age as
  select u.login, p.birthday 
  from users u
  join profiles p on u.id = p.user_id 
  order by p.birthday;
-- 8) хранимые процедуры / триггеры;
-- функция показывает характеристики игрока
drop function if exists get_player;
delimiter //
CREATE function get_player (id int)
returns text reads sql data
begin 
	set @player_id = id;

	return concat(@player_id, ' ',
      (select gender from players where player_id = @player_id) , 
      ' ',(select tall from players where player_id = @player_id) );
end//
delimiter ;
select get_player(5) ;

-- функция показывает данные о юзере

drop function if exists get_user;
delimiter //
CREATE function get_user (user_id int)
returns text reads sql data
begin 
	set @id = user_id;
	return concat(@id, ' ',
      (select login from users where id = @id) , 
      ' ',(select email from users where id = @id) );
end//
delimiter ;
select get_user(5) ;

-- триггер при добавлении игроков считает общее количество игроков
DROP TRIGGER if exists player_count;

delimiter //
CREATE TRIGGER player_count AFTER INSERT ON players
FOR EACH ROW
BEGIN
  SELECT COUNT(*) into @total_player_id from players;
END//
delimiter ;

insert into players values (362, 'f', 24,'1995-07-30 13:17:51', 198);
select @total_player_id;

-- триггер при удалении юзеров считает их количество

DROP TRIGGER if exists users_count;

delimiter //
CREATE TRIGGER users_count AFTER delete ON users
FOR EACH ROW
BEGIN
  SELECT COUNT(*) into @total_users_id from users;
END//
delimiter ;

delete from users where id = 100;
select @total_users_id;